(9, 'New Order', 'neworder', '<h3 style=\"font-family: \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgb(0,=\"\" 0,=\"\" 0);\"=\"\"><div><font color=\"#181c32\" face=\"Inter, Helvetica, sans-serif\"><span style=\"font-size: 13px;\"><br></span></font></div></h3>', '1', '1', '', '', '', '2025-07-04 08:28:58', '2', ''),
(14, 'Terms', 'terms', '<p class=\"text-center\" style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều Khoản - Quy Định - Chính sách - Hướng dẫn =&gt; Hãy đọc thật kỹ để tránh bị thiệt</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">* Nghiêm cấm sử dụng dịch vụ và đặt đơn có nội dung hoặc mục đích vi phạm pháp luật, chính trị, đồ trụy... Nếu cố tình vi phạm bạn phải tự chịu hoàn toàn trách nhiệm nội dung hoặc đơn hàng của bạn trước pháp luật, Hệ thống web&nbsp;<span style=\"font-weight: 700;\">SmmView.Pro</span>&nbsp;là tự động vì vậy sẽ không quản lý được hết các đơn hàng hay nội dung của các bạn, số lượng khách sử dụng lớn, chính vì vậy hãy nghiêm chỉnh chấp hành pháp luật.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><em><strong>Với 12 năm kinh nghiệm</strong></em><strong>&nbsp;kinh doanh, kiếm tiền online mmo, cung cấp dịch vụ và các khóa học liên quan trên Internet Uy tín, chất lượng. Rất nhiều đại lý và khách hàng đang sử dụng &nbsp;và phân phối lại dịch vụ tại SmmView.Pro&nbsp;</strong>chính vì thế chúng tôi lại luôn nói thẳng thật, từ tâm, không mập mờ để kiếm lợi nhuận như những dịch vụ ở chỗ khác, và đưa ra những quy định khắt khe cho dù có thể những quy định này chưa bao giờ gặp phải khi khách mua hàng, chưa bao giờ khách hàng bị phải tuy nhiên vì:</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><em><strong>Chúng tôi luôn muốn đặt lợi ích khách hàng lên hàng đầu, không muốn khách hàng mình bị thiệt thòi, Chúng tôi sẽ không mập mờ trong dịch vụ vì thế hãy chát với nhân viên và đọc kỹ các quy định dưới đây, Xin cảm ơn !</strong></em></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><em><strong>- Hệ thống sẽ luôn giới thiệu các loại view tốt và hợp lý khi các bạn hỏi tư vấn viên, nếu tự lựa chọn bạn có thể mua loại rẻ hay đắt tùy bạn nhưng hãy đọc kỹ mô tả và quy định.</strong></em></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">➡️ Bạn đồng ý việc sử dụng dịch vụ của&nbsp;<span style=\"font-weight: 700;\">SmmView.Pro</span>&nbsp;thông qua việc đồng ý điều khoản của chúng tôi. Bằng việc đăng ký tài khoản, bạn đã đọc và hiểu toàn bộ các điều khoản.&nbsp;<span style=\"font-weight: 700;\">SmmView.Pro</span>&nbsp;không giúp đỡ về mặt pháp lý hay bất kỳ lý do nào khác với người dùng.<br>➡️&nbsp;<span style=\"font-weight: 700;\">SmmView.Pro</span>&nbsp;không hoàn toàn cam kết đúng chuẩn xác về thời gian trong các dịch vụ. Chúng tôi đưa ra dự kiến chính xác nhất về thời gian chạy của các server. Điều này chỉ là ước lượng và được thống kê tại mục: \"Thời gian ước tính\".<br>➡️ Chúng tôi sẽ có sự thay đổi phù hợp về chính sách khi có thông báo. Bạn có trách nhiệm đọc toàn bộ chính sách và điều khoản trước khi thực hiện bất kỳ đơn hàng nào.<br>➡️ Sự thay đổi về phương thức thanh toán dựa theo thời kỳ.<br>➡️ Các dịch vụ nếu không ghi rõ quốc gia cụ thể mặc định là đa quốc gia.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><span style=\"font-weight: 700;\">SmmView.Pro</span>&nbsp;không chịu bất kỳ trách nhiệm nào gây hại cho bạn và công ty của bạn.<br><span style=\"font-weight: 700;\">SmmView.Pro</span>&nbsp;không chịu trách nhiệm cho bất cứ hình ảnh hay nội dung nào trên các mạng xã hội .</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều Khoản:</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><em><strong>Điều 1.1: Vui lòng đặt đơn thì xem kỹ mô tả và dịch vụ đăng đặt.</strong></em></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Cảnh Báo:</strong>&nbsp;Khi đang mua và sử dụng dịch vụ Không nên mua thêm chỗ khác nhé !</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Đặt view</strong>&nbsp;thì phải đặt link của video chứ không phải link kênh - Đặt bình luận Youtube thì link Youtube- Facebook thì chọn phần bình luận Facebook.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Đặt sub</strong>&nbsp;thì đặt link theo mô tả.&nbsp;<strong>Đặt like phải hiện số like</strong>, đặt theo dõi và đăng ký phải hiện số người đăng ký.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Không ẩn video, xóa video thay đổi link khi đang chạy</strong>, Khi tăng Follow TikTok thì ko thay đổi tên, link tăng xong mới đc thay. Nếu ko thì ko bảo hành.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 1.2: Quá trình sử dụng dịch vụ hãy đọc kỹ mô tả, tiêu đề loại đó, đặc biệt xem lại link mình chuẩn bị đặt hàng đúng chưa hãy bấm đặt nếu sai link là bị thiệt thòi đó.</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 1.3 : Không đặt dạng kiểu 1 loại bảo hành một loại không hành nếu tụt sẽ căn cứ theo các quy định dưới đây.&nbsp;</strong>( Đọc kỹ vấn đề này ở điều 3 và 3.1 &nbsp;và điều 5)</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Đọc Kỹ Bảo Hành&nbsp;</strong>( Không đến lúc lại không hiểu và cãi nhau mình sẽ không hỗ trợ nếu quy định đã có &nbsp;)</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 2.1: &nbsp;( Bảo Hành )</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>- Bảo hành theo từng loại dịch vụ có ghi rõ ở tên dịch vụ, mô tả của dịch vụ đó. \" Ví dụ bảo hành 30 ngày thì không phải hết 30 ngày là tụt hay hỏng đâu giống như mua điện thoại ấy họ bảo hành 12 tháng thì không phải cứ 12 tháng sau là hỏng đâu, ý bảo hành ở đây là sẽ hỗ trợ, bảo hành miễn phí nếu trong thời gian 12 tháng bảo hành đó\" .</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>- &nbsp;Bảo hành vĩnh viễn là nếu không đủ hay sụt giảm thì sẽ được bồi đắp, sửa, kéo lại, bù lại số mua đó đủ trọn đời cho link đó.</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>- Không Phải bảo hành 30 ngày là nó không tụt trong 30 ngày đâu mà Bảo hành 30 ngày là &nbsp;trong 30 ngày nếu tụt, sụt giảm, không đủ, sẽ được miễn phí bù trong thời gian 30 ngày đó . Đọc tiếp để hiểu hơn.</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Giải thích về bảo hành nghĩa là ví dụ như bảo hành 30 ngày nếu có vấn đề gì sẽ được bảo hành miễn phí không mất phí, sau 30 ngày sẽ không hỗ trợ. Ví như khi mua điện thoại bảo hành 12 tháng nếu có bất kỳ lỗi gì bạn sẽ được hỗ trợ, sửa miễn phí, tuy nhiên sau 12 tháng bạn sẽ phải bỏ tiền sửa hoặc không được hỗ trợ miễn phí nữa nhé. Còn ví dụ ( bảo hành vĩnh viễn thì nếu trong thời gian đó ví dụ như ko đủ view, tụt view, hay sub, like... sẽ được hỗ trợ bù lại không giới hạn thời gian. )</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Về bảo hành như view youtube chẳng hạn nếu bạn mua bị tụt trong thời gian bảo hành, bạn sẽ được bảo hành khôi phục hồi đủ lại số view đã mua đó, sau khi bảo hành tụt nếu trong thời gian còn bảo hành mà tiếp tục tụt bạn lại được bảo hành miễn phí tiếp, nhưng sau khi hết thời gian bản hành nếu bị tụt sẽ không được hỗ trợ và hồi view miễn phí nữa. Chính vì thế hãy mua theo sự hướng dẫn của các hỗ &nbsp;trợ viên đễ được hỗ trợ tốt nhất.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Dịch vụ có rất nhiều loại, có loại bảo hành vĩnh viễn , có loại bảo hành 30 hay 90 ngày, Có loại không bảo hành và không hỗ trợ sau khi mua, chúng tôi để các dịch vụ đa dạng vì có rất nhiều khách hàng khác nhau, có sự lựa chọn khác nhau, có khách chỉ cần dịch vụ tồn tại một thời gian nào đó họ có thể chọn loại rẻ không bảo hành kể cả tụt hết hoặc có lúc họ cảm thấy loại đó phù hợp và tốt với họ, có người không thích tụt hay giảm họ lại chọn loại khác, vì vậy chúng tôi sẽ để các loại cho mọi người tự chọn thoải mãi.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Thuật ngữ:</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Trạng thái \"Hủy và hoàn tiền\": Đơn hàng được hủy và trả tiền về tài khoản web 100%<br>- Trạng thái \"Hoàn tiền 1 phần\": Đơn hàng được hoàn tiền tương ứng số dịch vụ còn thiếu.<br>- Trạng thái \"Đang phân tích\": Hệ thống đang xử lý đơn hàng<br>- Trạng thái \"Đang thực hiện\": Hệ thống đang thực hiện đơn hàng<br>- Trạng thái \"Đang chờ\": Đơn hàng của bạn chờ hệ thống xử lý.<br>- &nbsp;Bảo hành: Hồi lại nếu đơn hàng bị tụt hoặc hoàn tiền khi hệ thống không thể hồi được nữa.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Bảo hành vĩnh viễn: Hồi lại view/like/sub... nếu view bị tụt trong bất kỳ thời gian nào cho tới khi server view/like/sub... đó không thể hoạt động được do youtube cập nhật hoặc vì một số lý do bất khả kháng.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- G60: Bảo hành trong 60 ngày<br>- G30: Bảo hành trong 30 ngày</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- H = giờ - S = giây - G, Days = ngày...</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 2.2&nbsp;</strong>&nbsp;<em><strong>Nếu trường hợp các bạn mua view từ hệ thống và đã có 1 lượng view ban đầu nhưng sau khi mua bị tụt dưới cả số view ban đầu chúng tôi sẽ không bảo hành, ko hủy, không hoàn&nbsp;</strong></em>tiền trong trường hợp này.&nbsp;<strong>Còn nếu để bảo hành hãy làm đủ view bạn đầu đó đã,&nbsp;</strong>đừng mua bằng ID đang muốn bảo hành ở web làm thế là sẽ tính đơn mới đó. Ví dụ: Bạn có 10.000 view ban đầu bạn mua 5000 view tại&nbsp;<span style=\"font-weight: 700;\">SmmView.Pro</span>&nbsp;nhưng tụt dưới cả 10.000 thì chứng tỏ các bạn đã sử dụng view chỗ khác, tự xem, tự cày view, hoặc mua loại nào khác khiến view tụt dưới cả số view ban đầu, chúng tôi không bảo hành trường hợp này. Vì thế hãy sư dụng view chất lượng tại&nbsp;<span style=\"font-weight: 700;\">SmmView.Pro</span>&nbsp;từ đầu.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 3:- Đừng mua cho 1 link &nbsp;video với 2 loại view Youtube khác nhau, sẽ không bảo hành hoặc bảo hành số lượng ít. Ví dụ: Link A đang chạy view Youtube loại ID 2300 xong sau đó lại chạy ID 513 nếu tụt chúng tôi sẽ chỉ bảo hành 1 số lượng ít nhất định . &nbsp;&nbsp;</strong><em><strong>( Nếu các bạn muốn đặt kiểu này vẫn &nbsp;đặt được nhưng các bạn tự chiệu thiệt nếu như view tụt.&nbsp;</strong></em>Trong trường hợp này bạn sẽ vi phạm điều 2.2&nbsp;<em><strong>)</strong></em></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>VD: Khi Bạn mua cho Link A với ID 513 = &nbsp;10.000 view Vip không tụt Sau đó bạn mua tiếp link A &nbsp;bằng ID Khác như 2300 &nbsp;= 10.000&nbsp;</strong>view = tổng bạn có 20.000 view nhưng sau đó tụt xuống còn 10.000 view bạn sẽ gặp rắc rối, vì không biết loại ID 513 hay ID 2300 &nbsp;tụt, Nhà ID 513 bảo đã chạy đủ 10.000 nhà ID 2300 cũng bảo đã chạy đủ 10.000, Nhà ID 513 bảo hiện đang 10.000 là vẫn đủ số view bên 513 đã chạy, còn bên 2300 cũng nói là đã đủ 10.000 bên ID 2300 đã chạy, bạn nói nếu chạy thì phải 20.000 chứ nhưng bên 2300 sẽ bảo Do bên ID 513 tụt thì sao hiện vẫn đủ 10.00 kìa, và như thế cả ID513 và 2300 đều đúng vì hiện đó vẫn đủ 10.000 view, Còn nếu tụt dưới 10.000 thì còn trong thời gian bảo hành ID513 sẽ phải bảo hành lên 10.000 còn ID 2300 báo tụt dưới số ban đầu sẽ không bảo hành, ID513 Bh đủ 10.000 thì sẽ quay lại báo đủ 10.000 ID 2300 sẽ không bảo hành trường hợp này. Chính vì thế nếu mua kiểu này sẽ gây thiệt hại nên anh em mua nên chú ý nhé, mua 1 loại sau đó thấy ổn thì mua số lượng nhiều, còn nếu không ổn tụt thì đợi bảo hành xong hãy mua loại khác, nếu mua loại khác luôn sẽ không được bảo hành. Mua loại khác đồng nghĩa với chúng ta sẽ chuyển sang phần quy định của dịch vụ khác đó, sẽ tính số hiện tại đó + số mua số mới = số hoàn thành, và quay về điều 2.2 . Nói thế chứ thực ra nó dễ lắm hãy dùng loại chất lượng như web thông báo, hướng dẫn nhé.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><em><strong>Ví dụ</strong></em>&nbsp;thêm : Bạn có 1000 view ban đầu =&gt; Bạn mua 5000 view loại ID 2300 sau đó mua 1000 loại ID 513 thì tổng số view cuối là 7000 Nhưng sau đó view tụt xuống chỉ còn 1000 thì chúng tôi sẽ không bảo hành Chỗ 6000 đó, Mà video bạn chỉ cần còn dư trên 1000 là chúng tôi sẽ tính đủ chứ không phâỉ 7000 đâu. Như vậy Số cuối cùng để bảo hành chỉ là một số lượng nhỏ của đơn bảo hành vĩnh viên, thôi chứ không phải cả 7000 kia đâu vì số lượng view cũ tụt, hoặc view rẻ tụt .... Chính vì thế đừng đặt nhiều loại view Youtube khác nhau rất khó bảo hành. Hãy đặt 1 loại thôi để đến lcus bảo hành mới dễ chứ không rất khó, không ai muốn làm khó khác hàng và ko muốn các bạn thiệt nên Admin nói trước như vậy nhé, còn các bạn mua thoải mãi luôn, nhưng nếu có vấn đề thì mình sẽ áp dụng điều luật quy định này. Áp dụng tương tự các dịch vụ khác.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 3.1: Lưu ý :&nbsp;</strong>Bạn có thể đặt nhiều link khác nhau cùng 1 dịch vụ hoặc nhiều dịch vụ<strong>. &nbsp;Cùng 1 dịch vụ và 1 link giống nhau thì nên đủ số lượng mua mới nên mua thêm. Nếu Không bạn sẽ bị thiệt hãy đọc giải thích sau:</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Ví dụ</strong>: Cùng 1 link xxx bạn đang chạy view chưa xong thì ko được mua view loại khác hay cùng loại cho link xxx này, link khác thì đc &nbsp;( Nếu chưa đủ vẫn đặt được nhưng hệ thống sẽ tính số view bạn đặt mới + với số view bạn mua = số cuối. VĐ: Cùng 1 link &nbsp;đặt 2 đơn đặt đè đơn 1 đặt 5000 đơn 2 cũng đặt 5000 thì nó sẽ tính số ban đầu của đơn 2 là đơn cuối ví dụ đơn 1 là 10 mà đơn 2 có 100 view thì nó sẽ tính xong là 5100 chứ không tính thành 10.000 view đâu.Còn link xxx này đang mua view có thể mua bình luận, hay like hay sub bình thường.&nbsp;</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 4</strong>:&nbsp;<a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;<strong>Bộ đếm chỉ đếm được số ban đầu bạn có + số bạn đặt = số hoàn thành. Khi mua chỉ chọn 1 loại cho 1 link.</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Nếu Số View đầu của bạn&nbsp;</strong>= 10 Tổng số bạn mua là 3000 ( 1 lần mua hoặc 3 lần mua cho 1 link ) thì tổng số cuối là 3010 là đủ&nbsp;<strong>nếu dưới 3010 mới là tụt</strong>. Chứ đừng thấy view lên 3050 rồi xuống 3010 nhầm là tụt. Vì chúng tôi luôn cho hơn số view ban đầu bạn mua để trừ đi 1 số view trùng khớp. Chúng tôi căn cứ thống kê số lượng hiển thị bên ngoài Youtube.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>+ Không đặt tiếp đè &nbsp;dịch vụ chưa đủ. ví dụ: Nếu đặt đè vẫn chạy nhưng bộ đếm sẽ tính số lượng ban đầu lúc bạn đặt đặt của đơn cuối nhất + số lượng ban đặt &nbsp;.</strong>&nbsp;<em><strong>Ví dụ đặt 1000 đang chạy chưa xong mới đc 500 view mà đặt tiếp 2000 nữa thì 2500 view coi như đủ. </strong>Đ</em>ôi khi đang ở trạng thái Pending dù đã đủ view vẫn không được mua view luôn. Nếu cố tình sảy ra lỗi không được bảo hành. Còn các dịch vụ khác đặt bình thường</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 5:</strong>&nbsp;?&nbsp;<a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\"><strong>⚠</strong></a><strong>Trường hợp đơn hàng bị tụt. Vui lòng đợi chúng tôi hoàn trả lại dịch vụ ( Bù view ) hoặc số tiền trước khi đặt đơn hàng mới. ( Nếu cố tình đặt đơn mới trước khi bù xong thì sẽ không được bù số cũ )&nbsp; Chúng tôi không thể tự động hủy ngay.</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>Hệ thống sẽ tự động đếm số khi bắt đầu, vì thế đừng hỏi chúng tôi đó là bao gồm VIEW/LIKE/SUBS... thật của bạn. Chúng tôi chỉ tính số bắt đầu và số kết thúc.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>Sau khi đặt hàng, nếu bạn tự ý thay đổi, đóng tài khoản hay tài khoản bị khóa. Chúng tôi không có trách nhiệm hoàn tiền.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>Nếu bạn đã chạy tại các website trước đó. Chúng tôi không có trách nhiệm hoàn lại khi tụt.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>Nếu bạn đặt đơn hàng \"KHÔNG BẢO HÀNH\" và đơn hàng \"BẢO HÀNH\". Chúng tôi không thể hoàn trả dịch vụ ( Bảo hành + KHÔNG bảo hành = KHÔNG bảo hành ).</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>Chúng tôi chỉ chấp nhận hủy đơn hàng nếu đơn hàng gặp lỗi của hệ thống.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>Nếu dịch vụ hiện tại đang bảo hành vĩnh viễn và đơn hàng đã hoàn thành xong trước đó. Khi xảy ra sự cố khiên server không thể hoạt động được để bảo hành. Chúng tôi có quyền dừng bảo hành đơn hàng đó.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>Các đơn hàng bảo hành vĩnh viễn có thể thay đổi thời gian bảo hành giữa chừng hoặc không thực hiện bảo hành phụ thuộc vào tình hình server lúc đó.&nbsp;<a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>Chúng tôi bảo hành căn cứ vào số ban đầu và kết thúc không phân biệt số view/like/sub... của bạn, nếu trong khoảng bộ đếm của đơn hàng chúng tôi sẽ thực hiện bảo hành nếu đủ yêu cầu.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 6:&nbsp;</strong><a target=\"_self\" href=\"http://web.archive.org/web/20210414004358/https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\"><strong>⚠</strong></a><strong>Điều kiện chạy view, sub, like &nbsp;( kể cả trong quá trình chạy ):</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Không sử dụng nhiều dịch vụ trong cùng 1 thời điểm ( hoặc ở các nguồn cung cấp khác ). Nếu bạn muốn sử dụng nhiều hơn với cùng 1 link, vui lòng đợi đơn hàng đã đặt Hoàn thành ( view, like, sub... đã hiển thị ra ngoài )/Hủy/Hoàn tiền. Chúng tôi không thể tăng con số chính xác nếu bạn sử dụng các dịch vụ khác. Chúng tôi sẽ không hoàn tiền hoặc bảo hành trường hợp này. Xin chú ý!</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Trường hợp đơn hàng bị tụt. Vui lòng đợi chúng tôi hoàn trả lại dịch vụ hoặc số tiền trước khi đặt đơn hàng mới. Chúng tôi không thể tự động hủy ngay, nếu bạn đặt tiếp đơn hàng khi đang trong quá trình bảo hành, chúng tôi không chấp nhận bảo hành đơn hàng đó và bạn sẽ mất bảo hành.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Hệ thống sẽ tự động đếm số khi bắt đầu, vì thế đừng hỏi chúng tôi đó là bao gồm VIEW/LIKE/SUBS... thật của bạn. Chúng tôi chỉ tính số bắt đầu và số kết thúc.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Sau khi đặt hàng, nếu bạn tự ý thay đổi, đóng tài khoản, tài khoản bị khóa, link đặt hàng sai cấu trúc, sai điều kiện chạy. Chúng tôi không có trách nhiệm hoàn tiền hoặc xử lý đơn hàng của bạn.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Nếu bạn đã chạy tại các website trước đó. Link đó sẽ không được bảo hành và bạn sẽ mất đơn hàng đó.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Nếu bạn đặt đơn hàng \"KHÔNG BẢO HÀNH\" và đơn hàng \"BẢO HÀNH\". Chúng tôi không thể hoàn trả dịch vụ ( Bảo hành + KHÔNG bảo hành = KHÔNG bảo hành ).<br><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Chúng tôi chỉ chấp nhận hủy đơn hàng nếu đơn hàng gặp lỗi của hệ thống.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Nếu dịch vụ hiện tại đang bảo hành vĩnh viễn và đơn hàng đã hoàn thành xong trước đó. Khi xảy ra sự cố khiến server không thể hoạt động được để bảo hành. Chúng tôi có quyền dừng bảo hành đơn hàng đó.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Các đơn hàng bảo hành vĩnh viễn có thể thay đổi thời gian bảo hành giữa chừng hoặc không thực hiện bảo hành phụ thuộc vào tình hình server lúc đó.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Chúng tôi bảo hành căn cứ vào số ban đầu và kết thúc không phân biệt số view/like/sub... của bạn, nếu trong khoảng bộ đếm của đơn hàng chúng tôi sẽ thực hiện bảo hành nếu đủ yêu cầu.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Điều kiện chạy view youtube ( kể cả trong quá trình chạy view ):<br>- Không đặt riêng tư<br>- Không chặn quốc gia<br>- Không bỏ nhúng =Bật nhúng lên<br>- Không bật giới hạn độ tuổi<br>- Đặt đúng loại view tương ứng với chế độ video, video upload thường đặt view thường, video live đặt view live, video công chiếu đặt view công chiếu. Không đặt view thường với video đã live hoặc đã công chiếu.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Hệ thống chỉ cam kết liên quan dịch vụ bạn chạy trên web này, những vấn đề bật tắt kiếm tiền trên kênh hệ thống không chịu trách nhiệm.<br>Nếu không đặt đúng điều kiện chạy view, chúng tôi sẽ không thể hỗ trợ xử lý đơn hàng đó và không hoàn tiền.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Hầu hết các loại view đều được tặng kèm view, nếu view bị tụt, chúng tôi có trách nhiệm hồi lại số view bạn đã chạy, không hồi lại số view tặng thêm.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Nếu đơn hàng không thực hiện sau 1 ngày thì các bạn hãy dừng đặt loại server đó và thông báo với admin qua facebook hoặc mục \"Bảo hành\" để xử lý.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a>&nbsp;Không bảo hành nếu cấu trúc link bị thay đổi ( VD: đổi tên khiến tên user thay đổi )</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">&nbsp;</a><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">&nbsp;</a>Bất kỳ trường hợp đe dọa hoặc cố ý gây khó dễ, hiểu nhầm, gậy hại tới web&nbsp;<span style=\"font-weight: 700;\">SmmView.Pro</span>, chúng tôi sẽ khóa tài khoản.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">&nbsp;</a>Khi đơn hàng đã thực hiện, nếu hệ thống gặp vấn đề thì đơn hàng đó sẽ được hoàn tiền tương ứng số còn thiếu của dịch vụ.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">&nbsp;</a>Từ ngữ Tất cả các dịch vụ từ hệ thống ( ngoài dịch vụ chạy quảng cáo từ các mạng xã hội ) đều&nbsp;<strong>có thể</strong>&nbsp;bị tụt nếu thuật toán trong tương lai của các mạng xã hội thay đổi, nếu dịch vụ khi KHÔNG TỤT có nghĩa là từ khi mở dịch vụ tới thời điểm hiện tại chưa xảy ra tình trạng tụt. Xin lưu ý.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">⚠</a><a target=\"_self\" href=\"https://emojipedia.org/warning-sign/\" style=\"color: var(--color-id-41);\">&nbsp;</a>Khi hệ thống bị kẹt, quá trình tiếp nhận khởi động lại sẽ diễn ra trong vòng 24h.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Nếu bạn không đồng ý và tranh luân với chúng tôi, chúng tôi sẽ áp dụng đúng điều khoản và xóa tài khoản của bạn. - Hoạt động gian lận sẽ bị khóa tài khoản. - Khi đơn hàng được hoàn tiền, nếu view/like/sub... tiếp tục tụt, chúng tôi không có trách nhiệm hoàn tiếp.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 7</strong>:&nbsp;<strong>CHÍNH SÁCH HOÀN TIỀN</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">-<strong>Số Tiền nạp dư và chưa sử dụng các bạn được bảo lưu sử dụng dùng dần trong các lần sau trong web.</strong>&nbsp;- &nbsp;Các bạn có thể nạp 1 lượng tiền nhỏ để thử sử dụng dịch vụ trước, nếu thấy hài lòng bạn hãy nạp số lượng lớn và sử dụng số lượng lớn sau,chúng tôi sẽ không có thời gian hoàn trả số dư về tài khoản ngân hàng, không hỗ trợ rút số $ còn dư. KHÔNG hoàn tiền trong trường hợp cố tình đe dọa, gây thiệt hại, tranh cãi. làm tổn thất, làm mất uy tín, rửa tiền, trung gian những hình thức mà pháp luật nghiêm cấm hoặc bất kỳ vấn đề nào mà chúng tôi cảm thấy bạn đang tác động xấu tới chúng tôi.<br>- Nếu bạn không đồng ý và tranh luận với chúng tôi, chúng tôi sẽ áp dụng đúng điều khoản quy định và xóa tài khoản của bạn.<br>- Hoạt động gian lận sẽ bị khóa tài khoản.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 8: CHÍNH SÁCH RIÊNG TƯ</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Chúng tôi sẽ nghiêm túc giữ bí mật thông tin cá nhân và bảo vệ quyền riêng tư của bạn.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Chúng tôi không xem hay can thiệp vào các đơn hàng của bạn vì web tự động trừ khi bạn có thông báo hỗ trợ riêng.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Tất cả thông tin cá nhân chỉ được sử dụng cho mục đích đặt hàng tại website. Chúng tôi sẽ không bán hay phân phối lại cho bất kỳ ai.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Bất kỳ trường hợp nào chúng tôi phát hiện gian lận sẽ lập tức khóa tài khoản và không thanh toán.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Nếu người được giới thiệu yêu cầu rút tiền hoặc bị trừ tiền vì lý do nào đó thì hoa hồng bạn nhận được cũng sẽ giảm tương ứng. &nbsp;- Nếu người được giới thiệu được giảm giá đặc biệt ở 1 dịch vụ nào đó, hoa hồng sẽ chỉ được cộng vào tài khoản trên website, hoặc nếu bạn yêu cầu rút tiền, chúng tôi sẽ hỗ trợ rút 50% số hoa hồng bạn nhận được.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Bảo hành vĩnh viễn: Hồi lại view/like/sub... nếu view bị tụt trong bất kỳ thời gian nào cho tới khi server&nbsp;view/like/sub... đó không thể hoạt động được do youtube cập nhật hoặc vì một số lý do bất khả kháng.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Hệ thống sẽ có thể chậm hoặc nâng cấp bất kỳ lúc nào nhằm mục đích nâng cao chất lượng và tốc độ. Vì vậy vui lòng kiên nhẫn chờ đợi trong quá trình nâng cấp thuật toán. Cảm ơn vì sự kiên nhẫn của bạn.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><strong>Điều 9: Vi Phạm Quy Định</strong></p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Nghiêm cấm sử dụng dịch vụ và đặt đơn có nội dung hoặc mục đích vi phạm pháp luật, chính trị, đồ trụy... Nếu cố tình vi phạm bạn phải tự chịu hoàn toàn trách nhiệm nội dung hoặc đơn hàng của bạn trước pháp luật, Hệ thống web&nbsp;<span style=\"font-weight: 700;\">SmmView.Pro</span>là tự động vì vậy sẽ không quản lý được hết các đơn hàng hay nội dung của các bạn, số lượng khách sử dụng lớn, chính vì vậy hãy nghiêm chỉnh chấp hành pháp luật.</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\">- Chúng tôi luôn luôn đặt vấn đề lợi ích khách hàng lên hàng đầu, mọi sự cố sẽ cố gắng thỏa hiệp giải quyết hiệu quả và có lợi nhất cho khách hàng với điều kiện bạn tuân thủ theo quy định trên, những khách hàng cố tình vi phạm chúng tôi sẽ chiếu theo quy định xử lý theo chiều hướng có lợi nhất cho khách hàng mà có thể. Xin cảm ơn !</p><p style=\"margin-bottom: 0px; color: rgb(51, 78, 110); font-family: Barlow, sans-serif;\"><br></p>', '1', '1', '', '', '', '2024-10-04 11:55:09', '2', ''),
